measurements.description:
Six flowers and two buds on eight upright inflorescences up to 17 cm; 
   dorsal sepal white overlaid fuchsia darkening on cauda;
   lateral sepals fuchsia, darker inferior surface, caudae dark fuchsia;
   petals white;
   lip dark fuchsia; column white;
   substance heavy; texture velvety; petals and lip dimentions estimated, not measured.
